Now that we have our base structs, we can implement the Middleware trait for our SurfMiddleware struct. We'll start with the is_method_get_head method, but first we must make sure we derive async_trait. #[async_trait::async_trait]
impl Middleware for SurfMiddleware<'_> { ... The is_method_get_head will check the request stored in our SurfMiddleware struct and return true if the method is GET or HEAD, false otherwise. fn is_method_get_head(&self) -> bool { self.req.method() == Method::Get || self.req.method() == Method::Head
} Next we'll implement the policy method. This method accepts a reference to the HttpResponse and returns a CachePolicy with default options. We'll use the http_cache_semantics::CachePolicy::new method to generate the policy. fn policy(&self, response: &HttpResponse) -> Result<CachePolicy> { Ok(CachePolicy::new(&self.parts()?, &response.parts()?))
} The policy_with_options method is similar to the policy method, but accepts a CacheOptions struct to override the default options. We'll use the http_cache_semantics::CachePolicy::new_options method to generate the policy. fn policy_with_options( &self, response: &HttpResponse, options: CacheOptions,
) -> Result<CachePolicy> { Ok(CachePolicy::new_options( &self.parts()?, &response.parts()?, SystemTime::now(), options, ))
} Next we'll implement the update_headers method. This method accepts a reference to the http::request::Parts and updates the request headers. We will iterate over the part headers and attempt to convert the header value to a HeaderValue and set the header on the request. If the conversion fails, we will return an error. fn update_headers(&mut self, parts: &Parts) -> Result<()> { for header in parts.headers.iter() { let value = match HeaderValue::from_str(header.1.to_str()?) { Ok(v) => v, Err(_e) => return Err(Box::new(BadHeader)), }; self.req.set_header(header.0.as_str(), value); } Ok(())
} The force_no_cache method is used to override the Cache-Control header in the request to 'no-cache' derective. This is used to allow caching but force revalidation before resuse. fn force_no_cache(&mut self) -> Result<()> { self.req.insert_header(CACHE_CONTROL.as_str(), "no-cache"); Ok(())
} The parts method is used to return the http::request::Parts from the request which eases working with the http_cache_semantics crate. fn parts(&self) -> Result<Parts> { let mut converted = request::Builder::new() .method(self.req.method().as_ref()) .uri(self.req.url().as_str()) .body(())?; { let headers = converted.headers_mut(); for header in self.req.iter() { headers.insert( http::header::HeaderName::from_str(header.0.as_str())?, http::HeaderValue::from_str(header.1.as_str())?, ); } } Ok(converted.into_parts().0)
} The url method is used to return the requested Url in a standard format. fn url(&self) -> Result<Url> { Ok(self.req.url().clone())
} The method method is used to return the HTTP method of the request as a String to standardize the format. fn method(&self) -> Result<String> { Ok(self.req.method().as_ref().to_string())
} Finally, the remote_fetch method is used to perform the request and return the HttpResponse. async fn remote_fetch(&mut self) -> Result<HttpResponse> { let url = self.req.url().clone(); let mut res = self.next.run(self.req.clone(), self.client.clone()).await?; let mut headers = HashMap::new(); for header in res.iter() { headers.insert( header.0.as_str().to_owned(), header.1.as_str().to_owned(), ); } let status = res.status().into(); let version = res.version().unwrap_or(Version::Http1_1); let body: Vec<u8> = res.body_bytes().await?; Ok(HttpResponse { body, headers, status, url, version: version.try_into()?, })
} Our SurfMiddleware struct now meets the requirements of the Middleware trait. We can now implement the surf::middleware::Middleware trait for our Cache struct.

